INSERT INTO `game` VALUES (1,'Monkey Kick','Help Monkey Kick Furball to the hills and beyond! How far can you get?','Help Monkey Kick Furball to the hills and beyond! How far can you get?','monkey kick.png','<div class=\"miniclip-game-embed\" data-game-name=\"monkey-kick\" data-theme=\"5\" data-width=\"800\" data-height=\"800\" data-language=\"en\"></div>','2020-03-27 19:00:00'),(2,'Quick fire pool instant ','Quickfire Pool for instant play! Pocket as many balls before time runs out in 8 ball billiards. New rack of 14 balls given when you are down to one.','Quickfire Pool for instant play! Pocket as many balls before time runs out in 8 ball billiards. New rack of 14 balls given when you are down to one. \r\n\r\nUse the mouse to drag the stick and then release','quick fire instant pool.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"quickfire-pool-instant\" data-theme=\"5\" data-width=\"550\" data-height=\"900\" data-language=\"en\"></div>','2020-03-27 19:00:00'),(3,'Short ride','Choose your hero and get to the finish without losing your head! Avoid obstacles and try to complete the levels with all your body parts.','Choose your hero and get to the finish without losing your head! Avoid obstacles and try to complete the levels with all your body parts.','shortride.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"short-ride\" data-theme=\"5\" data-width=\"800\" data-height=\"480\" data-language=\"en\"></div>','2020-04-27 19:00:00'),(4,'Bloxorz','Get the block to fall into the square hole to progress to the next level','Get the block to fall into the square hole to progress to the next level','Bloxorz_.gif','<div class=\"miniclip-game-embed\" data-game-name=\"bloxorz\" data-theme=\"5\" data-width=\"1024\" data-height=\"768\" data-language=\"en\"></div>','2020-05-14 00:22:27'),(5,'Zomball','A basketball game of bone-breaking skill and agility. Throw your own zombified body parts into the Hoop of Skulls to climb ever higher on the Skullcano of Doom.','A basketball game of bone-breaking skill and agility. Throw your own zombified body parts into the Hoop of Skulls to climb ever higher on the Skullcano of Doom.','Zomball.png','<div class=\"miniclip-game-embed\" data-game-name=\"zomball\" data-theme=\"5\" data-width=\"600\" data-height=\"800\" data-language=\"en\"></div>','2020-05-14 00:23:21'),(6,'Zombie Choppa','As a rescue pilot in the zombie apocalypse, guide the Rescue Chopper towards the red flares to pick up survivors and transport them back to a safe-zone helipad but beware of the zombies which will try to grab hold of your chopper and stop you from flying. Use your flying skills to shake them off and regain control of your helicopter.','As a rescue pilot in the zombie apocalypse, guide the Rescue Chopper towards the red flares to pick up survivors and transport them back to a safe-zone helipad but beware of the zombies which will try to grab hold of your chopper and stop you from flying. Use your flying skills to shake them off and regain control of your helicopter.','Zombie choppa.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"zombie-choppa\" data-theme=\"5\" data-width=\"960\" data-height=\"540\" data-language=\"en\"> </div>','2020-05-14 00:25:41'),(7,'Slime Pizza','As Slime Pizza\'s delivery boy, your ship crash lands and all the pizzas have been scattered! Collect all the pizza you can, but beware the watchful eye of the planet\'s patrol officer!','As Slime Pizza\'s delivery boy, your ship crash lands and all the pizzas have been scattered! Collect all the pizza you can, but beware the watchful eye of the planet\'s patrol officer!','slimepizza.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"slime-pizza\" data-theme=\"5\" data-width=\"480\" data-height=\"640\" data-language=\"en\"> </div>','2020-05-14 00:30:00'),(8,'Big Shot Boxing','Some people call boxing The Hurt Business. The bright Vegas lights and the million dollar pay cheques are a distant dream for most boxers. \r\n\r\nClimbing the ranks to the top of the world is never going to be easy, dreams can be shattered with just one punch. Just a handful of fighters will have the will and the skill to drag themselves up from the canvas and keep on fighting.\r\n\r\nBig Shot Boxing gives you the opportunity to live out the career of a professional boxer from their debut to retirement. Choose how to train your fighter and manage their progression up the ranks. Will you build up skills and experience fighting journeymen or will you race up the ranks to challenge for the title?\r\n\r\n\r\n','Find your own fighting style, box behind the jab and counter punch or throw caution to the wind and go for the knockout!','big shot boxing.png','<div class=\"miniclip-game-embed\" data-game-name=\"big-shot-boxing\" data-theme=\"5\" data-width=\"520\" data-height=\"350\" data-language=\"en\"> </div>','2020-05-14 00:31:53'),(9,'Shootermata','Make your way through the adrenaline fuelled levels in this dynamic futuristic shooter.','Make your way through the adrenaline fuelled levels in this dynamic futuristic shooter.','shootermata.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"shootermata\" data-theme=\"5\" data-width=\"800\" data-height=\"600\" data-language=\"en\"> </div>','2020-05-14 00:33:47'),(10,'Cartapult','Cartapult is the game for those with rubber to burn! Take each unlockable vehicle, adorn with drums of gasoline and cartapult into the city to cause maximum mayhem and destruction! Look out for secrets and rack up your high score with ever-amazing chain reactions. Crazy games don\'t get crazier than this!','Cartapult is the game for those with rubber to burn! Take each unlockable vehicle, adorn with drums of gasoline and cartapult into the city to cause maximum mayhem and destruction! Look out for secrets and rack up your high score with ever-amazing chain reactions. Crazy games don\'t get crazier than this!','cartapult.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"cartapult\" data-theme=\"5\" data-width=\"960\" data-height=\"640\" data-language=\"en\"> </div>','2020-05-14 00:35:34'),(11,'Sleigh Shot','Summer is here, Santa is nowhere to be seen, but new contenders are now taking part in the Sleigh Shot challenge! Now with added Multiplayer!','Summer is here, Santa is nowhere to be seen, but new contenders are now taking part in the Sleigh Shot challenge! Now with added Multiplayer!','SleighShot.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"sleigh-shot\" data-theme=\"5\" data-width=\"1024\" data-height=\"768\" data-language=\"en\"> </div>','2020-05-14 00:38:11'),(12,'Battle Golf Online','It\'s time to get the golf clubs out and whack some balls. Aim for the golf holes or the heads of your opponents in real-time multiplayer madness!','It\'s time to get the golf clubs out and whack some balls. Aim for the golf holes or the heads of your opponents in real-time multiplayer madness!','battel golf.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"battle-golf-online\" data-theme=\"5\" data-width=\"960\" data-height=\"600\" data-language=\"en\"> </div>','2020-05-14 00:39:21'),(13,'Flip Master','Master the trampoline with Frontflips, Backflips, Gainers, Layouts, Jumps and Bounces on your backyard, gym or circus trampolines and train to be the Master of Trampoline! \r\n\r\nWith a custom physics engine and animated Ragdoll Physics, Flip Master is the most dynamic and entertaining Trampoline experience ever created! Defy the laws of physics and prove yourself worthy!\r\n','Master the trampoline with Frontflips, Backflips, Gainers, Layouts, Jumps and Bounces on your backyard, gym or circus trampolines and train to be the Master of Trampoline! \r\n\r\nWith a custom physics engine and animated Ragdoll Physics, Flip Master is the most dynamic and entertaining Trampoline experience ever created! Defy the laws of physics and prove yourself worthy!\r\n','flip-master.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"flip-master\" data-theme=\"5\" data-width=\"488\" data-height=\"670\" data-language=\"en\"> </div>','2020-05-14 00:40:47'),(14,'Twisted Lines','Twisted Lines is a new mind twisting puzzle game with a unique game mechanic wrapped in a beautiful minimalist design.\r\n\r\nCross the lines to swap colors and collect all hollow squares to solve the puzzle. \r\n','Twisted Lines is a new mind twisting puzzle game with a unique game mechanic wrapped in a beautiful minimalist design.\r\n\r\nCross the lines to swap colors and collect all hollow squares to solve the puzzle. \r\n','twisted line.png','<div class=\"miniclip-game-embed\" data-game-name=\"twisted-lines\" data-theme=\"5\" data-width=\"500\" data-height=\"660\" data-language=\"en\"> </div>','2020-05-14 00:42:02'),(15,'Flip Diving','Featuring a custom physics engine with animated ragdoll physics, Flip Diving is the most dynamic and entertaining cliff diving experience ever created! \r\n\r\nTONS OF DIVING TRICKS\r\nLayouts, Pikes, Reverses - and more tricks coming soon! Each trick dynamically animated with ragdoll physics! \r\n\r\nDEATH-DEFYING LOCATIONS\r\nDive from trees, boats, trampolines and more! Over 50 jump platforms to leap from! \r\n\r\nA HUGE RANGE OF CHARACTERS\r\nTake a dive as a bodybuilder, a businessman, or in a penguin costume! Each diver has different abilities, weights, and unique physics!\r\n','Pull off Frontflips, Backflips & Gainers from high cliffs, rickety platforms, trees, castles, and trampolines! Choose from a wide range of divers, and unlock new tricks and moves. Aim for a perfect entry into the water, and dont hit the rocks! ','flip-diving.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"flip-diving\" data-theme=\"5\" data-width=\"488\" data-height=\"670\" data-language=\"en\"></div>','2020-05-14 00:48:20'),(16,'Multiplayer','In Splix.io you must conquer as much land as possible and try to become biggest Splix.io of all! Don\'t let other players hit your tail, don\'t hit your own tail. Enclose other players\' areas to rise up the leaderboard for ultimate domination!','In Splix.io you must conquer as much land as possible and try to become biggest Splix.io of all! Don\'t let other players hit your tail, don\'t hit your own tail. Enclose other players\' areas to rise up the leaderboard for ultimate domination!','splixio.webp','<div class=\"miniclip-game-embed\" data-game-name=\"splixio\" data-theme=\"5\" data-width=\"1010\" data-height=\"800\" data-language=\"en\">  </div>','2020-05-14 00:50:27'),(17,'Cheap Golf','Hello, my name is SUSAN. and I am the host of CHEAP GOLF. It is a retromodern low-poly minigolf game. You will fling a boop into the goal many times and I will talk to you between levels','Hello, my name is SUSAN. and I am the host of CHEAP GOLF. It is a retromodern low-poly minigolf game. You will fling a boop into the goal many times and I will talk to you between levels','cheap golf.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"cheap-golf\" data-theme=\"5\" data-width=\"910\" data-height=\"510\" data-language=\"en\"></div>','2020-05-14 00:56:06'),(18,'Basketball stars','Play your friends or take on the world in Basketball Stars!\r\nThe worlds best multiplayer Basketball game on mobile, from the creators of multiple smash-hit online sports games! Dribble, shoot, score, WIN! Grab the ball and take on the world with BASKETBALL STARS. \r\n\r\nPlay fast-paced, authentic 1v1 multiplayer basketball! Show your skills, moves and fakes to juke out your opponent and shoot for the basket! On defense, stay in the face of the attacker, steal the ball, and time your leaps to block their shots! All in REAL-TIME! \r\n\r\nREALISTIC 3D GRAPHICS\r\nBasketball on mobile has never looked this good: fully customisable 3D players and a variety of environments to play in! \r\n\r\nCOMPETE 1-ON-1 IN TWO AWESOME MULTIPLAYER GAME MODES\r\nTest your dueling instincts in 1v1 Matches, or race to shoot hoops in time-based 1v1 Shootouts. \r\n\r\nINCREDIBLE REWARDS AND HUNDREDS OF UNIQUE ITEMS\r\nPlaying like an all-star? Enter higher-ranked matches with bigger stakes, and unlock special basketballs and unique wearables to grow your power and style. \r\n\r\nLEVEL UP\r\nStart out on the Underdog court and play your way up to the top. Gain access to more exclusive courts and compete with the best Basketball Stars players out there! \r\n\r\nKEY FEATURES\r\n2 different online multiplayer game modes\r\n300+ customisation items = thousands of unique looks!\r\n40+ unlockable basketballs\r\nDribble, feint, shoot, steal, block and get powerful bonuses off the backboard Free to play!\r\n	True 1-on-1 basketball gameplay\r\n	Realistic 3D graphics\r\n	Easy to pick-up, challenging to master\r\n','Play your friends or take on the world in Basketball Stars!\r\nThe worlds best multiplayer Basketball game on mobile, from the creators of multiple smash-hit online sports games! Dribble, shoot, score, WIN! Grab the ball and take on the world with BASKETBALL STARS. \r\n\r\nPlay fast-paced, authentic 1v1 multiplayer basketball! Show your skills, moves and fakes to juke out your opponent and shoot for the basket! On defense, stay in the face of the attacker, steal the ball, and time your leaps to block their shots! All in REAL-TIME! \r\n\r\n','basketball stars.png','<div class=\"miniclip-game-embed\" data-game-name=\"basketball-stars\" data-theme=\"5\" data-width=\"650\" data-height=\"650\" data-language=\"en\">  </div>','2020-05-14 00:58:08'),(19,'Stop Trump','President Donald Trump has upset some Limeys with his immigration policy. You\'re a UK Border Guard and Her Majesty, Queen Elizabeth II, has instructed you to Stop Trump entering the country. As you ask new arrivals for their papers, please, can you spot Trump as he tries to sneak in? Get it right or the Queen will royally penalise you. If you prefer the alternative view, you can choose Trump mode, play as Donald Trump and make sure only your supporters get in. How do you like them apples, Britain?','President Donald Trump has upset some Limeys with his immigration policy. You\'re a UK Border Guard and Her Majesty, Queen Elizabeth II, has instructed you to Stop Trump entering the country. As you ask new arrivals for their papers, please, can you spot Trump as he tries to sneak in? Get it right or the Queen will royally penalise you. If you prefer the alternative view, you can choose Trump mode, play as Donald Trump and make sure only your supporters get in. How do you like them apples, Britain?','StopTrump.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"stop-trump\" data-theme=\"5\" data-width=\"900\" data-height=\"440\" data-language=\"en\"></div>','2020-05-14 01:00:07'),(20,'Agar.io','The internet sensation is now on Apple and Android! \r\n\r\n- Grow your cell, eat others and avoid being eaten\r\n\r\n- Climb to the top of the leaderboard\r\n\r\n- Choose special usernames to play with secret skins\r\n\r\n\r\nPlay in free-for-all, teams, experimental or party mode. \r\n\r\nIt\'s cell eat cell out there!\r\n','The internet sensation is now on Apple and Android! \r\n\r\n- Grow your cell, eat others and avoid being eaten\r\n\r\n- Climb to the top of the leaderboard\r\n\r\n- Choose special usernames to play with secret skins\r\n\r\n\r\nPlay in free-for-all, teams, experimental or party mode. \r\n\r\nIt\'s cell eat cell out there!\r\n','Agar.io.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"agar-io\" data-theme=\"5\" data-width=\"1000\" data-height=\"1000\" data-language=\"en\"></div>','2020-05-14 01:00:54'),(21,'Stealth Sniper 2','Your mission: to eliminate criminals. Your weapon: a sniper rifle. Be careful not to alert your targets! If they become too alert or manage to get away, you will fail the mission.','Your mission: to eliminate criminals. Your weapon: a sniper rifle. Be careful not to alert your targets! If they become too alert or manage to get away, you will fail the mission.','StealthSniper2_150x110.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"stealth-sniper-2\" data-theme=\"5\" data-width=\"1135\" data-height=\"650\" data-language=\"en\">  </div>','2020-05-14 01:01:57'),(22,'ProBaseball','Step up to the home plate and get ready to bat a home run. In Pro Baseball you must make quick decisions with good timing if you want to score the winning runs and bring home the trophy. While batting, keep an eye on the placement of the outfielders and aim the ball away from them. When pitching, trace the pattern as quickly and accurately as possible for the best throw. Earn bonus points with better batting accuracy, higher average pitch speeds and greater point differences in a win! \r\n\r\nStep up to the plate - play now and go for the home run!\r\n','Step up to the home plate and get ready to bat a home run. In Pro Baseball you must make quick decisions with good timing if you want to score the winning runs and bring home the trophy. While batting, keep an eye on the placement of the outfielders and aim the ball away from them. When pitching, trace the pattern as quickly and accurately as possible for the best throw. Earn bonus points with better batting accuracy, higher average pitch speeds and greater point differences in a win! \r\n\r\nStep up to the plate - play now and go for the home run!\r\n','probaseball.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"probaseball\" data-theme=\"5\" data-width=\"608\" data-height=\"457\" data-language=\"en\">  </div>','2020-05-14 01:03:07'),(23,'Pilot Heroes','A multi-level arcade flying game where you must extinguish fires, avoid trees, chase other planes and a whole bunch of other missions! Collecting gems increases your pilot ranking and there is a log book to track progress. Play Pilot Heroes now!','A multi-level arcade flying game where you must extinguish fires, avoid trees, chase other planes and a whole bunch of other missions! Collecting gems increases your pilot ranking and there is a log book to track progress. Play Pilot Heroes now!','Pilot-Heroes_150x110.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"pilot-heroes\" data-theme=\"5\" data-width=\"450\" data-height=\"700\" data-language=\"en\"></div>','2020-05-14 01:05:16'),(24,'Bow Master Halloween','Hunt wisps in the newest Bow Master game! Enter spooky settings where bright targets dart and dance to escape your arrows. Different wisps have different tricks - some vanish or hide, some trigger actions that reveal other targets and some are just plain hard to hit! Speed and accuracy will earn you extra points. Keep an eye out for the secret pumpkin in each level to score even more bonus points. Enter the graveyard and start hunting those wisps now!','Hunt wisps in the newest Bow Master game! Enter spooky settings where bright targets dart and dance to escape your arrows. Different wisps have different tricks - some vanish or hide, some trigger actions that reveal other targets and some are just plain hard to hit! Speed and accuracy will earn you extra points. Keep an eye out for the secret pumpkin in each level to score even more bonus points. Enter the graveyard and start hunting those wisps now!','bowmasterhalloween.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"bow-master-halloween\" data-theme=\"5\" data-width=\"680\" data-height=\"510\" data-language=\"en\"></div>','2020-05-14 01:08:59'),(25,'Stealth Sniper','Your mission: to eliminate criminals. Your weapon: a sniper rifle. To get to the big boss you\'ll have to go through his henchmen. If you manage to hide a body, make a headshot or get combo kills, you\'ll earn bonus points. Be careful not to alert your targets! If they become too alert or manage to get away, you will fail the mission. Whatever you do, don\'t let the boss escape - take aim now and take them down!','Your mission: to eliminate criminals. Your weapon: a sniper rifle. To get to the big boss you\'ll have to go through his henchmen. If you manage to hide a body, make a headshot or get combo kills, you\'ll earn bonus points. Be careful not to alert your targets! If they become too alert or manage to get away, you will fail the mission. Whatever you do, don\'t let the boss escape - take aim now and take them down!','stealthsniperv3.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"stealth-sniper\" data-theme=\"5\" data-width=\"680\" data-height=\"510\" data-language=\"en\">	</div>','2020-05-14 01:10:45'),(26,'Banana Mania','How skillful are you at throwing bananas? Launch Bananas at the gorillas. Don\'t miss, or throw bombs at the gorillas otherwise it\'s game over!','How skillful are you at throwing bananas? Launch Bananas at the gorillas. Don\'t miss, or throw bombs at the gorillas otherwise it\'s game over!','Bananamania_2_150x110.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"banana-mania\" data-theme=\"5\" data-width=\"480\" data-height=\"640\" data-language=\"en\"></div>','2020-05-14 01:12:13'),(27,'Celebrity Ice Bucket Challenge','Take part in the Celebrity Ice Bucket Challenge, use waterbombs to hit the target and soak top celebrities with ice cold water to raise awareness of ALS for The ALS Association.','Take part in the Celebrity Ice Bucket Challenge, use waterbombs to hit the target and soak top celebrities with ice cold water to raise awareness of ALS for The ALS Association.','celebrity ice.png','<div class=\"miniclip-game-embed\" data-game-name=\"celebrity-ice-bucket-challenge\" data-theme=\"5\" data-width=\"800\" data-height=\"550\" data-language=\"en\"></div>','2020-05-14 01:13:09'),(28,'Calabash Bros','A horde of strange and vicious creatures is pouring into the lands of the Calabash Bros. Protect the territory from enemy attack by building a variety of towers. Barracks will send out melee soldiers, Freeze towers slow your enemies, Magic towers send out bolts of lightning and Turrets cause area damage for when a single strike isn\'t enough. For extra devastation call down a meteor shower or lightning strike, or summon a skill soldier to make a last stand. \r\n\r\nPlay now and help the Calabash Bros defeat the evil invaders!\r\n','A horde of strange and vicious creatures is pouring into the lands of the Calabash Bros. Protect the territory from enemy attack by building a variety of towers. Barracks will send out melee soldiers, Freeze towers slow your enemies, Magic towers send out bolts of lightning and Turrets cause area damage for when a single strike isn\'t enough. For extra devastation call down a meteor shower or lightning strike, or summon a skill soldier to make a last stand. \r\n\r\nPlay now and help the Calabash Bros defeat the evil invaders!\r\n','CalabashBros.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"calabash-bros\" data-theme=\"5\" data-width=\"700\" data-height=\"570\" data-language=\"en\"></div>','2020-05-14 01:14:04'),(29,'Man or Monster','Monster hunters meet man eaters in an epic standoff! \r\n\r\nVisit some of the world\'s greatest cities and defend them from massive monster invasions with a powerful arsenal of weapons - or take on the role of the monster and show the humans who\'s really at the top of the food chain. \r\n\r\nPlay as a man: The people of the world need a hero in these dangerous times, and monster hunting happens to be your specialty. No monster is too big when you can fly into the sky to meet them face-to-face with a jetpack - and even the toughest of foes can\'t ignore your tanks, helicopters, turrets and other defensive weaponry. Save civilians and maximize the number of undamaged buildings to earn cash. \r\n\r\nPlay as a monster: Stomp your way from Amsterdam to Tokyo blowing fire, eating civilians and generally doing what monsters do best - wreaking havoc and mayhem! Destroy buildings and enemy units, collect treasure and eliminate the human cities to collect as much cash as possible. The Man might have tanks - but what is a little tank going to do against your awesome tail spins, toxic dumps and spider minions? \r\n\r\nAre you a man...or a monster? Play now and make your choice!\r\n','Play as a man: The people of the world need a hero in these dangerous times, and monster hunting happens to be your specialty. No monster is too big when you can fly into the sky to meet them face-to-face with a jetpack - and even the toughest of foes can\'t ignore your tanks, helicopters, turrets and other defensive weaponry. Save civilians and maximize the number of undamaged buildings to earn cash. \r\n\r\nPlay as a monster: Stomp your way from Amsterdam to Tokyo blowing fire, eating civilians and generally doing what monsters do best - wreaking havoc and mayhem! Destroy buildings and enemy units, collect treasure and eliminate the human cities to collect as much cash as possible. The Man might have tanks - but what is a little tank going to do against your awesome tail spins, toxic dumps and spider minions? \r\n\r\nAre you a man...or a monster? Play now and make your choice!\r\n','man or mon.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"man-or-monster\" data-theme=\"5\" data-width=\"960\" data-height=\"640\" data-language=\"en\"></div>','2020-05-14 01:16:05'),(30,'Sprint Club Nitro','An arcade style racing game with 9 increasingly challenging levels across 3 different landscapes. Race amongst 20 cars to the finish collecting nitro boosts to overtake. Spend your race winnings on upgrades to improve the car - from better grip and higher top speeds to longer nitro boosts!','An arcade style racing game with 9 increasingly challenging levels across 3 different landscapes. Race amongst 20 cars to the finish collecting nitro boosts to overtake. Spend your race winnings on upgrades to improve the car - from better grip and higher top speeds to longer nitro boosts!','Sprint_Club_150x110.jpg','<div class=\"miniclip-game-embed\" data-game-name=\"sprint-club-nitro\" data-theme=\"5\" data-width=\"640\" data-height=\"365\" data-language=\"en\"></div>','2020-05-14 01:18:15'),(31,'Total Wreckage','Crash a